import style from './SearchBar.module.css';

function SearchBar({ onSearch }) {
   return (
      <div className={style.div}>
         <input type='search' className={style.input}/>
         <button className={style.button} onClick={(id) => {
            onSearch(id);
         }}>Agregar</button> 
      </div>
   );
}

export default SearchBar;
